import React from "react";
import { createUseStyles } from "react-jss";
import clsx from "clsx";

const useStyles = createUseStyles({
  paging__list: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    gap: "0.7rem",
    border: "3px solid var(--background-color-header)",
  },
  paging__item: {
    width: "4.2rem",
    height: "4rem",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "1.5rem",
    borderRadius: "1rem",
    backgroundColor: "var(--background-color-header)",
  },
  paging__chevron: {
    margin: "0 1rem",
    color: "var(--bg-btn-pink)",
  },
  paging__input: {},
});

export default function Paging({ data }) {
  const classes = useStyles();
//   console.log(data);

  return (
    <div className={clsx(classes.paging__list)}>
      <div className={clsx(classes.paging__item, classes.paging__chevron)}>
        <ion-icon name="chevron-back"></ion-icon>
      </div>

      <div className={clsx(classes.paging__item)}>1</div>
      <div className={clsx(classes.paging__item)}>...</div>
      <input type="number" className={classes.paging__input} />
      <div className={clsx(classes.paging__item)}>8</div>

      <div className={clsx(classes.paging__item, classes.paging__chevron)}>
        <ion-icon name="chevron-forward"></ion-icon>
      </div>
    </div>
  );
}
